import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import ProductDashboard from './ProductDashboard';
import StockMovementDashboard from './StockMovementDashboard';

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Stock Management Dashboard</h1>
        <nav>
          <ul>
            <li><a href="/">Product Dashboard</a></li>
            <li><a href="/stock-movements">Stock Movement Dashboard</a></li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<ProductDashboard />} />
          <Route path="/stock-movements" element={<StockMovementDashboard />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
